import React from 'react'

function Filter({ name, done, onDone }) {
  const handleCheck = (e) => {
    const done = e.target.checked;
    console.log(e.target.checked);
    onDone(done, name);
  }

  return (
    <div className="Filtr">
      <input type="checkbox" checked={done} onChange={handleCheck} />
      <span>{name}</span>
    </div>
  )
}

export default React.memo(Filter)
